#include <iostream>
#include <vector>
using namespace std;

class Solution {
public:
    int maxProduct(vector<int>& nums) {
        int a = 0, b = 0, pos;
        for (pos = nums.size() - 1; pos >= 0; pos--) {
            if (nums[pos] == 1) {
                a++;
            } else if (nums[pos] == -1) {
                b++;
            } else {
                break;
            }
        }
        if (pos == -1) {
            if (a > 0 || b > 1) {
                return 1;
            } else {
                return -1;
            }
        }
        int max = nums[0];
        for (int i = 0; i <= pos; i++) {
            int sum = nums[i];
            if (max < sum) {
                max = sum;
            }
            for (int j = i + 1; j <= pos; j++) {
                sum *= nums[j];
                if (max < sum) {
                    max = sum;
                }
            }
            if (b > 0 && sum < 0) {
                if (max < -sum) {
                    max = -sum;
                }
            }
        }
        if ((a > 0 || b > 1) && max < 1) {
            return 1;
        }
        if (b > 0 && max < -1) {
            return -1;
        }
        return max;
    }
};

